Che dire? Sarà una festa! 
Vado a scegliere l'outfit ✨✨✨✨

Posso cantare tutto l'r'n'b del mondo, i tempi storti e i groove pazzeschi... Ma poi, mi sciolgo per i brani di Sanremo.

ALMENO TU NELL' UNIVERSO. 
Brano scritto da Bruno Lauzi e Maurizio Fabrizio nel 1974, rimasto inedito fino al 1989, anno in cui venne assegnato a Mia Martini che lo presentò al festival di Sanremo ottenendo il premio della critica.

Che dire amici, ieri ci siamo emozionanti tutti a ricantare i brani che hanno fatto la storia del nostro paese... PERCHÉ SANREMO È SANREMO!

